import modules from './DessertsInfo.module.css';

const DessertsInfo = () => {
  return (
    <section className={modules.info}>
      <h2>Delicious Desserts, Delivered To You</h2>
      <p>
        Choose your favorite dessert from our broad selection of provided desserts
        and enjoy your sweets.
      </p>
      <p>
        All our desserts are prepared with high-quality ingredients, just-in-time and
        of course by experienced chefs!
      </p>
    </section>
  );
};

export default DessertsInfo;
